      out.write("\t\t\t\t\t\t\t제6조(회원가입) <br>\r\n");
      out.write("\t\t\t\t\t\t\t<br> ① 이용자는 “몰”이 정한 가입 양식에 따라 회원정보를 기입한 후 이 약관에 동의한다는 의사표시를\r\n");
