      out.write("\t\t\t\t\t\t\t회원으로 등록합니다.<br>\r\n");
      out.write("\t\t\t\t\t\t\t<br> 1. 가입신청자가 이 약관 제7조제3항에 의하여 이전에 회원자격을 상실한 적이 있는 경우, 다만\r\n");
      out.write("\t\t\t\t\t\t\t제7조제3항에 의한 회원자격 상실 후 3년이 경과한 자로서 “몰”의 회원재가입 승낙을 얻은 경우에는 예외로 한다.<br>\r\n");
      out.write("\t\t\t\t\t\t\t2. 등록 내용에 허위, 기재누락, 오기가 있는 경우<br> 3. 기타 회원으로 등록하는 것이 “몰”의\r\n");
      out.write("\t\t\t\t\t\t\t기술상 현저히 지장이 있다고 판단되는 경우<br>\r\n");
      out.write("\t\t\t\t\t\t\t<br> ③ 회원가입계약의 성립 시기는 “몰”의 승낙이 회원에게 도달한 시점으로 합니다.<br>\r\n");
      out.write("\t\t\t\t\t\t\t<br> ④ 회원은 회원가입 시 등록한 사항에 변경이 있는 경우, 상당한 기간 이내에 “몰”에 대하여\r\n");
      out.write("\t\t\t\t\t\t\t회원정보 수정 등의 방법으로 그 변경사항을 알려야 합니다.<br>\r\n");
      out.write("\t\t\t\t\t\t\t<br> 제7조(회원 탈퇴 및 자격 상실 등) <br>\r\n");
      out.write("\t\t\t\t\t\t\t<br> ① 회원은 “몰”에 언제든지 탈퇴를 요청할 수 있으며 “몰”은 즉시 회원탈퇴를 처리합니다.<br>\r\n");
      out.write("\t\t\t\t\t\t\t<br> ② 회원이 다음 각 호의 사유에 해당하는 경우, “몰”은 회원자격을 제한 및 정지시킬 수 있습니다.<br>\r\n");
      out.write("\t\t\t\t\t\t\t<br> 1. 가입 신청 시에 허위 내용을 등록한 경우<br> 2. “몰”을 이용하여 구입한 재화\r\n");
      out.write("\t\t\t\t\t\t\t등의 대금, 기타 “몰”이용에 관련하여 회원이 부담하는 채무를 기일에 지급하지 않는 경우<br> 3. 다른\r\n");
      out.write("\t\t\t\t\t\t\t사람의 “몰” 이용을 방해하거나 그 정보를 도용하는 등 전자상거래 질서를 위협하는 경우<br> 4. “몰”을\r\n");
